import AboutImage from "../asserts/18-yellow.avif"


const About = ()=>{

    return (
        <div className="flex">
        <img className="w-1/3" src={AboutImage} alt="" />
        <h1 className="w-1/2">About Enfield</h1>
        </div>
    )
}

export default About;
